import React, {Fragment} from 'react'
import finalboss from '../../sprites/final-boss.gif'


const PlayerBattleSprite = () => {
    return(
        <div id="player-sprite">
            <h2>Player 1</h2>
            <img src={finalboss} height="200px" />
            <h3>HP: 100</h3>
        </div>
    )
}

export default PlayerBattleSprite;
